import { memo } from "react";
import ApiTable from "../../components/TableView/ApiTable";
import { columns, RadioBoxOptions } from "./constant";
import RadioBox from "../../components/radioBox/component";
import FormView from "./Partials/FormView"

const InvoicesSearch = () => {
    return (
        <>
            <RadioBox
                name="invoicesType"
                options={RadioBoxOptions}
            />
            <FormView />
            <div style={{ display: "flex" }}>
                <ApiTable
                    columns={columns}
                    api="invoices/pop_supplier_invoices"
                    rowKey="invoice_id"
                    width="35%"
                />
                <ApiTable
                    columns={columns}
                    api="invoices/pop_supplier_invoices"
                    rowKey="invoice_id"
                    width="65%"
                />
            </div>
        </>
    )
}

export default memo(InvoicesSearch)
